export function toSvgUrl(images: FitImages): FitImages {
  const urlImages: FitImages = {};
  for (const imgId of Reflect.ownKeys(images)) {
    const value: string = Reflect.get(images, imgId);
    urlImages[imgId as FitImageId] = 'url("data:image/svg+xml,' + value + '")';
  }
  return urlImages;
}
